import React, { FunctionComponent } from "react";
import styled from "styled-components";
import { IThemeStateProps } from "../../../interfaces/types";

// Need Icons for images..

// Need Arrows for buttons

const StripContainer = styled.div`
  width: 100%;
  max-height: 150px;
  flex: 1;

  background-color: pink;
`;

interface IImageStripProps {
  data: any;
  themeState: IThemeStateProps;
}

const ImageStrip: FunctionComponent<IImageStripProps> = ({ data }) => {
  return <StripContainer></StripContainer>;
};

export default ImageStrip;
